import React, { useState } from 'react'
import axios from 'axios';
import Navbar from './Navbar';
import './Navbar_style.css';
import './HomePage.css';

export const HomePage = () => {
	const [toStation, setToStation] = useState('');
	const [fromStation , setFromStation] = useState(''); 
	const [journeyDate , setDate] = useState(''); 
	const [trainClass , setClass] = useState(''); 
	const [Category , setCategory] = useState(''); 

	const options = {
	method: 'GET',
	url: 'https://irctc1.p.rapidapi.com/api/v3/trainBetweenStations',
	params: {
		fromStationCode: {fromStation},
		toStationCode: {toStation},
		dateOfJourney: {journeyDate}
	},
	headers: {
		'X-RapidAPI-Key': 'SIGN-UP-FOR-KEY',
		'X-RapidAPI-Host': 'irctc1.p.rapidapi.com'
	}
	};


	const train_API = async()=>{try {
		const response = await axios.request(options);
		console.log(response.data);
	} catch (error) {
		console.error(error);
	}}

	return (
		<div>
			<Navbar />
			<div className='booking_input' id='booking_input'>
				<div className='selection'>
					<label htmlFor="to">TO</label>
					<input type="text" list='city' name='to' value={toStation} onChange={(e)=>{setToStation(e.target.value)}} />
				</div>
				<button id='shift'></button>
				<div className='selection'>
					<label htmlFor="from">FROM</label>
					<input type="text" list='city' name='from' value={fromStation} onChange={(e)=>{setFromStation(e.target.value)}} />
				</div>


				<datalist id='city'>
					<option value="Ahmeadabad" />
					<option value="Surat" />
					<option value="Gandhinagar" />
					<option value="Mumbai" />
					<option value="Delhi" />
				</datalist>
			</div>

			<div className='booking_input' id='booking_input'>
				<div className='selection'>
					<label htmlFor="date">DATE</label>
					<input type="date" name='Date' value={journeyDate} onChange={(e)=>{setDate(e.target.value)}} />
				</div>
				<div className='selection'>

					<label htmlFor="class">CLASS</label>
					<select name="class" id="class_selection" value={trainClass} onChange={(e)=>{setClass(e.target.value)}}>

						<option value="All_classes">All Classes</option>
						<option value="General">General</option>
						<option value="AC">AC</option>
						<option value="Non-AC">Non-AC</option>
					</select>
				</div>
				<div className='selection'>

					<label htmlFor="categoty">Category</label>
					<select name="class" id="category_selection" value={Category} onChange={(e)=>{setCategory(e.target.value)}}>
						<option value="General">General</option>
						<option value="Ladies">Ladies</option>
						<option value="PWD">PWD</option>
						<option value="Sn_Citizen">Senior Citizen</option>
					</select>
				</div>

				<div className='inputGrp'>
						<button id='submit' type='submit'>Register</button>
					</div>

				<div className='train_details'>

				</div>
			</div>


		</div>
	)
}

export default HomePage;
